import Home from "./routes/Home";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

function App() {
  return (
    <Rounter>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Rounter>
  );

}

export default App;
